  // convert the text to Morse code
  for (int i = 0; i < text.length(); i++) {
    char c = text.charAt(i);
    if (c >= 'A' && c <= 'Z') {
      c = c - 'A' + 'a';
    }
    if (c >= 'a' && c <= 'z') {
      int index = c - 'a';
      Serial.print(morseCode[index]);
      Serial.print(" ");
      playMorseCode(morseCode[index]);
    } else if (c == ' ') {
      Serial.print(" ");
      delay(wordSpaceDuration);
    }
  }

  // add a space between words
  Serial.println();
  delay(wordSpaceDuration);
}

